// src/pages/Confidentialite.js
import React from 'react';

const Confidentialite = () => {
  return (
    <div className="page-container">
      <h1>Politique de confidentialité</h1>
      <div className="content-card">
        <p>
          Cette application respecte votre vie privée et s'engage à protéger les données personnelles que vous pourriez nous fournir.
        </p>
        <p>
          Nous ne collectons aucune donnée personnelle sans votre consentement explicite.
        </p>
        <p>
          Les grilles sauvegardées sont stockées localement sur votre appareil et ne sont pas transmises à nos serveurs.
        </p>
      </div>
    </div>
  );
};

export default Confidentialite;
